// MARK: 1. Flood fill.
// Runtime: 32 ms, faster than 55.40% of C++ online submissions for Surrounded Regions.
// Memory Usage: 17.3 MB, less than 6.25% of C++ online submissions for Surrounded Regions.
class Solution1 {
public:
    /*
     * Character meanings:
     * 
     * 'O': Places to flood fill.
     * 'X': Surrounding places.
     * 'T': Temporary flood fill character. If any of them are on the edges, then the 'T' characters will be left unchanged.
     */
    void solve(vector<vector<char>>& board) {
        if ((board.size() <= 1) || (board.at(0).size() <= 1)) {
            // Width or height is 1: all characters are edge characters.
            return;
        }
        
        // Assume board->at(x)->at(y);

        // Flood fill all 'O's and group them.
        /// (x, y) pairs.
        // vector<vector<pair<int, int>>> floodFillPairs;

        for (int i = 0; i < board.size(); i += 1) {
            auto& currentRow = board.at(i);
            for (int j = 0; j < currentRow.size(); j += 1) {
                char currentCharacter = currentRow.at(j);
                if (currentCharacter == 'O') {
                    // Solution 1. Begin recursive flood fill process (stack overflow).
//                    auto currentFloodFillResult = floodFillAndChangeRecursively(board, i, j);
//                    if (!currentFloodFillResult.first) {
//                        // Replace every character in `currentFloodFillResult` to 'X'.
//                        for (const auto& aCoordinate: currentFloodFillResult.second) {
//                            board.at(aCoordinate.first).at(aCoordinate.second) = 'X';
//                        }
//                    }
                    
                    // Solution 2: queue.
                    floodFillAndChange(board, i, j);
                }
            }
        }

        // Replace all 'T's to 'O's.
        for (int i = 0; i < board.size(); i += 1) {
            auto& currentRow = board.at(i);
            for (int j = 0; j < currentRow.size(); j += 1) {
                if (currentRow.at(j) == 'T') {
                    currentRow.at(j) = 'O';
                }
            }
        }
    }

    /**
     * Queue-based flood fill.
     * 
     * This will hopefully prevent the stack overflow problem.
     */
    void floodFillAndChange(vector<vector<char>>& board, int startX, int startY) {
        auto boardWidth = board.size();
        auto boardHeight = board.at(0).size();
        
        bool hasEdgeCharacters = false;
        
        vector<pair<int, int>> allCoordinates;
        queue<pair<int, int>> coordinatesToJudge;
        allCoordinates.push_back(make_pair(startX, startY));
        coordinatesToJudge.push(make_pair(startX, startY));
        
        while (!coordinatesToJudge.empty()) {
            auto currentCoordinate = coordinatesToJudge.front();
            coordinatesToJudge.pop();
            
            if (board.at(currentCoordinate.first).at(currentCoordinate.second) == 'O') {
                board.at(currentCoordinate.first).at(currentCoordinate.second) = 'T';
                allCoordinates.push_back(currentCoordinate);
                
                if (currentCoordinate.first > 0) {
                    coordinatesToJudge.push(make_pair(currentCoordinate.first - 1, currentCoordinate.second));
                } else {
                    // This is an edge character.
                    hasEdgeCharacters = true;
                }
                
                if (currentCoordinate.first < (boardWidth - 1)) {
                    coordinatesToJudge.push(make_pair(currentCoordinate.first + 1, currentCoordinate.second));
                } else {
                    // This is an edge character.
                    hasEdgeCharacters = true;
                }
                
                if (currentCoordinate.second > 0) {
                    coordinatesToJudge.push(make_pair(currentCoordinate.first, currentCoordinate.second - 1));
                } else {
                    // This is an edge character.
                    hasEdgeCharacters = true;
                }
                
                if (currentCoordinate.second < (boardHeight - 1)) {
                    coordinatesToJudge.push(make_pair(currentCoordinate.first, currentCoordinate.second + 1));
                } else {
                    // This is an edge character.
                    hasEdgeCharacters = true;
                }
            }
        }
        
        if (!hasEdgeCharacters) {
            for (const auto& aCoordinate: allCoordinates) {
                board.at(aCoordinate.first).at(aCoordinate.second) = 'X';
            }
        }
    }

    /**
     * Flood fill from a starting point. Fill every character to 'T'.
     * 
     * @note This recursive function causes stack overflow on my machine and the OJ with the extremely large test case...
     * 
     * @return `true` if the area is replacd to 'T' (has edge pixels); `false` if the area is replaced to 'X' (no edge pixels).
     */
    pair<bool, vector<pair<int, int>>> floodFillAndChangeRecursively(vector<vector<char>>& board, int startX, int startY) {
        if (board.at(startX).at(startY) != 'O') {
            return make_pair(false, vector<pair<int, int>>({}));
        }

        bool hasEdgePixels = false;
        vector<pair<int, int>> returnedFilledCoordinates;

        board.at(startX).at(startY) = 'T';
        returnedFilledCoordinates.push_back(make_pair(startX, startY));


        auto boardWidth = board.size();
        auto boardHeight = board.at(1).size();

        if (startX < (boardWidth - 1)) {
            auto result = floodFillAndChangeRecursively(board, startX + 1, startY);

            if (result.first) {
                hasEdgePixels = true;
            }

            returnedFilledCoordinates.insert(returnedFilledCoordinates.end(), result.second.begin(), result.second.end());
        } else {
            hasEdgePixels = true;
        }

        if (startX > 0) {
            auto result = floodFillAndChangeRecursively(board, startX - 1, startY);

            if (result.first) {
                hasEdgePixels = true;
            }

            returnedFilledCoordinates.insert(returnedFilledCoordinates.end(), result.second.begin(), result.second.end());
        } else {
            hasEdgePixels = true;
        }

        if (startY < (boardHeight - 1)) {
            auto result = floodFillAndChangeRecursively(board, startX, startY + 1);

            if (result.first) {
                hasEdgePixels = true;
            }

            returnedFilledCoordinates.insert(returnedFilledCoordinates.end(), result.second.begin(), result.second.end());
        } else {
            hasEdgePixels = true;
        }

        if (startY > 0) {
            auto result = floodFillAndChangeRecursively(board, startX, startY - 1);

            if (result.first) {
                hasEdgePixels = true;
            }

            returnedFilledCoordinates.insert(returnedFilledCoordinates.end(), result.second.begin(), result.second.end());
        } else {
            hasEdgePixels = true;
        }

        return make_pair(hasEdgePixels, returnedFilledCoordinates);
    }
};


// MARK: 2. Start from the edges
// Runtime: 28 ms, faster than 85.23% of C++ online submissions for Surrounded Regions.
// Memory Usage: 14.3 MB, less than 34.38% of C++ online submissions for Surrounded Regions.
class Solution {
public:
    void solve(vector<vector<char>>& board) {
        if ((board.size() <= 1) || (board.at(0).size() <= 1)) {
            // Width or height is 1: all characters are edge characters.
            return;
        }
        
        auto boardWidth = board.size();
        auto boardHeight = board.at(0).size();
        
        // Start from the edges.
        for (int i = 0; i < boardWidth; i += 1) {
            int j1 = 0;
            int j2 = boardHeight - 1;
            
            auto& currentCharacter1 = board.at(i).at(j1);
            if (currentCharacter1 == 'O') {
                // Flood fill from this point.
                floodFillAndChange(board, i, j1);
            }
            
            auto& currentCharacter2 = board.at(i).at(j2);
            if (currentCharacter2 == 'O') {
                floodFillAndChange(board, i, j2);
            }
        }
        
        for (int j = 1; j < (boardHeight - 1); j += 1) {
            int i1 = 0;
            int i2 = boardWidth - 1;
            
            auto& currentCharacter1 = board.at(i1).at(j);
            if (currentCharacter1 == 'O') {
                floodFillAndChange(board, i1, j);
            }
            
            auto& currentCharacter2 = board.at(i2).at(j);
            if (currentCharacter2 == 'O') {
                floodFillAndChange(board, i2, j);
            }
        }
        
        // Replace all 'O's with 'X's, 'T's with 'O's.
        for (int i = 0; i < boardWidth; i += 1) {
            for (int j = 0; j < boardHeight; j += 1) {
                char& currentCharacter = board.at(i).at(j);
                if (currentCharacter == 'O') {
                    currentCharacter = 'X';
                } else if (currentCharacter == 'T') {
                    currentCharacter = 'O';
                }
            }
        }
    }
    
    /**
     * Flood fill from a starting point and change all characters to 'T'.
     */
    void floodFillAndChange(vector<vector<char>>& board, int startX, int startY) {
        auto boardWidth = board.size();
        auto boardHeight = board.at(0).size();
        
        queue<pair<int, int>> coordinatesToJudge;
        coordinatesToJudge.push(make_pair(startX, startY));
        
        while (!coordinatesToJudge.empty()) {
            auto currentCoordinate = coordinatesToJudge.front();
            coordinatesToJudge.pop();
            
            if (board.at(currentCoordinate.first).at(currentCoordinate.second) == 'O') {
                board.at(currentCoordinate.first).at(currentCoordinate.second) = 'T';
                
                if (currentCoordinate.first > 0) {
                    coordinatesToJudge.push(make_pair(currentCoordinate.first - 1, currentCoordinate.second));
                }
                
                if (currentCoordinate.first < (boardWidth - 1)) {
                    coordinatesToJudge.push(make_pair(currentCoordinate.first + 1, currentCoordinate.second));
                }
                
                if (currentCoordinate.second > 0) {
                    coordinatesToJudge.push(make_pair(currentCoordinate.first, currentCoordinate.second - 1));
                }
                
                if (currentCoordinate.second < (boardHeight - 1)) {
                    coordinatesToJudge.push(make_pair(currentCoordinate.first, currentCoordinate.second + 1));
                }
            }
        }
    }
};


void printTwoDimensionalMatrix(const vector<vector<char>> matrix) {
    for (const auto& aRow: matrix) {
        for (const char& aCharacter: aRow) {
            cout << aCharacter << " ";
        }
        cout << "\n";
    }
    cout << endl;
}

